import React,{Component} from 'react';
import './App.css';
import Navbar from './component/Navbar';
 import News from './component/News';
 import {
   BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";


export default class App extends Component{
 name = "harry";
 render(){
  return (
    <Switch>
    <div>
     <Navbar></Navbar>
     <br></br>

     <Switch>
     <Route  path = "/"><News pageSize = {5} country = "in" category = "sports"></News></Route>
      <Route  path = "/sports"><News pageSize = {5} country = "in" category = "sports"></News></Route>
      <Route  path = "/buisness"><News pageSize = {5} country = "in" category = "buisness"></News></Route>
      <Route  path = "/entertainment"><News pageSize = {5} country = "in" category = "entertainment"></News></Route>
      <Route  path = "/general"><News pageSize = {5} country = "in" category = "general"></News></Route>
      <Route  path = "/health"><News pageSize = {5} country = "in" category = "health"></News></Route>
      <Route  path = "/technology"><News pageSize = {5} country = "in" category = "technology"></News></Route>
     </Switch>
    </div>
    </Switch>
  );
 }


};
